import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {Navbar, Container, Dropdown, DropdownButton} from 'react-bootstrap';
import logotipo from '../../assets/logo-better-price.png';
import linkedin from '../../assets/logo-linkedin.png';
import gmail from '../../assets/logo-gmail.png';
import github from '../../assets/logo-github.png';
import './styles.css' 

const Nav = (props)=>{
return (
      <nav className="decorate-nav">
        <Navbar expand="lg">
        <Container> 
          <Navbar.Brand href="#home">
            <img src={logotipo} alt='Logotipo de Better Price' Style="width:5.4em; height: 60px"/>
          </Navbar.Brand> 
            <DropdownButton
              as='Warning'
              key='Warning'
              variant='warning'
              title="Mi Cuenta"
            >
              <Dropdown.Item href='#'> Iniciar Sesion</Dropdown.Item>
              <Dropdown.Item href='#'> Registrarse</Dropdown.Item>
            </DropdownButton>
        </Container>
        </Navbar>
      </nav>
  );
}



const Layout = (props) =>{
  return(
    <>
        {props.children}
      <footer> 
        <h5>Dise√±ado y Desarrollado por: </h5>
        <div className="container-names">
          <div className="container-subject">
            <p>Milena Encinales</p>
            <div className="Container-redes">
              <div className="linkedin">
                <img src={linkedin} alt="icono de linkedin"/>
              </div>
              <div className="github">
                <img src={github} alt="icono de github"/>
              </div>
              <div className="gmail">
                <img src={gmail} alt="icono de gmail"/>
              </div>
            </div>
          </div>
        </div> 
      </footer>
    </>
  );
}

export default Layout;
